import React from 'react'
import AppleLogin from 'react-apple-login'

const AppleSignIn = () => {
    return (
        <div>
            <AppleLogin clientId="com.react.apple.login" redirectURI="http://localhost/Dashbaord" />
        </div>
    )
}

